import about_img from "../src/images/about_img.svg";

const Sdata = [
    {
        head:"Web Development",
        imgsrc:about_img
    },
    {
        head:"Web Designing",
        imgsrc:about_img,
    },
    {
        head:"Web Application Developemnt",
        imgsrc:about_img
    },
    {
        head:"Python Software Development",
        imgsrc:about_img
    },
    {
        head:"Database Administrator",
        imgsrc:about_img
    },
    {
        head:"Database Administrator",
        imgsrc:about_img
    }
]; 

export default Sdata;
